import React from "react";
import { Box, Heading, List, ListItem } from "@chakra-ui/react";

const RecentActions = () => {
  return (
    <Box p="2em">
      <Heading>Recent Actions</Heading>
      <Box>
        <List>
            <ListItem></ListItem>
        </List>
      </Box>
    </Box>
  );
};

export default RecentActions;
